set nocount on

-- remove volatile data 

declare @volatile table (id int identity(1,1) primary key, name varchar(100), cantruncate bit)
insert into @volatile (name, cantruncate) values ('LogEntry',0)
insert into @volatile (name, cantruncate) values ('Email', 1)
insert into @volatile (name, cantruncate) values ('Document', 1)
insert into @volatile (name, cantruncate) values ('Claim', 0)
insert into @volatile (name, cantruncate) values ('Policy', 0)
insert into @volatile (name, cantruncate) values ('Customer', 0)
insert into @volatile (name, cantruncate) values ('Investigator', 0)
insert into @volatile (name, cantruncate) values ('AccountAuthentication', 1)
insert into @volatile (name, cantruncate) values ('AccountPassword', 1)
insert into @volatile (name, cantruncate) values ('Account', 0)

declare @count int
select @count = count(*) from @volatile
declare @i int = 1
declare @name varchar(100)
declare @cantruncate bit

while @i <= @count begin
	select @name = name, @cantruncate = cantruncate from @volatile where id = @i 

	if @cantruncate = 1
		exec('truncate table ' + @name)
	else
		exec('delete from ' + @name)

	set @i = @i + 1
end

